import React from "react";
import Modal from "react-modal/lib/components/Modal";
import Logo from "../../assets/img/Brasao_ufra.png";

const NavMain = ({handleOpenModal, modalIsOpen, handleCloseModal}) => {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
        <div class="container-fluid">
          <img src={Logo} width="50px" height="50px" alt="Logo da Ufra" />
          <a class="navbar-brand ms-2" href="#Main">
            Museu de Entomologia
          </a>
          <button
            class="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span class="navbar-toggler-icon"></span>
          </button>
          <div
            class="collapse navbar-collapse justify-content-end"
            id="navbarNavAltMarkup"
          >
            <div class="navbar-nav">
              <button type="button" class="btn btn-outline-light" onClick={handleOpenModal}>
                Login
              </button>
            </div>
          </div>
        </div>
      </nav>
      <Modal
        isOpen={modalIsOpen}
        onRequestClose={handleCloseModal}
      >
        <h1>Ola</h1>
        <button onClick={handleCloseModal}>close</button>

      </Modal>
    </>
  );
};

export default NavMain;
